import React, { Component } from "react";
import Footer from "../layout/Footer";
import Header from "../layout/Header";
import Sidebar from "../layout/Sidebar";
import { Link } from "react-router-dom";
import Chart from "react-apexcharts";

const axios = require("axios").default;

class ProjectActivityGraph extends Component {

  constructor(props) {
    super(props);
    // this.state = {
    //   options: {
    //     plotOptions: {
    //       radialBar: {

    //         // startAngle: -180,
    //         // endAngle: 180,

    //         track: {
    //           background: "#f2f2f2",
    //           strokeWidth: "90%"
    //         },
    //         dataLabels: {
    //           show: true,
    //           value: {
    //             show: true,
    //             fontSize: "10px"
    //           },
    //           total: {
    //             show: true,
    //             fontSize: "8px",
    //             label: "Activity (34/36)",
    //             color: "#373d3f"
    //           }
    //         }
    //       }
    //     }
    //   },

    //   series: [94.4]
    // };
    this.state = {
          
      series: [70],
      options: {
        chart: {
          height: 350,
          type: 'radialBar',
        },
        plotOptions: {
          radialBar: {
            hollow: {
              size: '70%',
            }
          },
        },
        labels: ['Cricket'],
      },
    
    
    };
  

  }

  render() {

    return (
      <>
        <Header />
        <Sidebar />
        <div className="content-wrapper">

          {/* Content Header (Page header) */}
          <div className="content-header">
            <div className="container-fluid">
              <Link to="/overall-dashboard/12">
                <button style={{ float: "right" }} className="btn btn-primary "> <i className="fa fa-arrow-left font-weight-bold" />   </button>
              </Link>
              <div className="row">
                <div className="col-md-12">

                  <div className="card">
                    <div className="card-header" style={{ backgroundColor: "#d8479c" }}>
                      <h5 className="text-center text-white text-primary"> CDG project activity graph </h5>
                    </div>

                    <div className="card-body">

                      <div className="form-group row">
                        <label className="col-md-12" >Select year</label>
                        <select
                          className="form-control col-md-6"
                          name="yearOfProjectActivity"
                          id="yearOfProjectActivity"
                          value={this.state.selectedYearProjectActivity}
                          onChange={this.onChangeYearProjectActivity}

                        >
                          <option selected=""> All </option>
                          {/* {yearsSelectOption} */}
                        </select>
                      </div>

                      
                    </div>
                    <div className="row text-center">
                        <div className="col-md-2 card">
                          <Chart
                            options={this.state.options}
                            series={this.state.series}
                            type="radialBar"
                            width="180"
                          />
                           <label className="p-2"> MOU/Aggrement</label>
                        </div>
                        {/* <div className="col-md-2">
                          <Chart
                            options={this.state.options}
                            series={this.state.series}
                            type="radialBar"
                            width="230"
                          />
                          <label> MOU/Aggrement</label>
                        </div>
                        <div className="col-md-2">
                          <Chart
                            options={this.state.options}
                            series={this.state.series}
                            type="radialBar"
                            width="230"
                          />
                           <label> MOU/Aggrement</label>
                        </div>
                        <div className="col-md-2">
                          <Chart
                            options={this.state.options}
                            series={this.state.series}
                            type="radialBar"
                            width="230"
                          />
                           <label> MOU/Aggrement</label>
                        </div>
                        <div className="col-md-2">
                          <Chart
                            options={this.state.options}
                            series={this.state.series}
                            type="radialBar"
                            width="230"
                          />
                           <label> MOU/Aggrement</label>
                        </div>
                        <div className="col-md-2">
                          <Chart
                            options={this.state.options}
                            series={this.state.series}
                            type="radialBar"
                            width="230"
                          />
                           <label> MOU/Aggrement</label>
                        </div> */}
                      </div>
                  </div>
                  
                </div>

              </div>


              {/* /.row */}
            </div>

            {/* /.container-fluid */}
          </div>
        </div>
        <aside className="control-sidebar control-sidebar-dark">
          {/* Control sidebar content goes here */}
        </aside>

        <Footer />
      </>

    );
  }
}

export default ProjectActivityGraph;
